export interface estruturaPokemon{
  name:string,
  img:string

}

export class ListPokemon{
  pokemon1: estruturaPokemon={
    name:'charizar',
    img:'../../assets/images/Mewtow.png',

  }
  pokemon2: estruturaPokemon={
    name:'picachu',
    img:'../../assets/images/Raichu.png',

  }

  pokemon3: estruturaPokemon={
    name:'bolbazor',
    img:'../../assets/images/bb.png',

  }
  pokemon4: estruturaPokemon={
    name:'duc',
    img:'../../assets/images/duc.png',

  }
}
